import React from 'react';
import pokemons from './data.js';
import './App.css';

function Teste() {
  const arrayPokemons = pokemons;
  const listPokemons = arrayPokemons.map((el) =>
    <li key={el.id}>
    {el.name}</li>
  );
  return (
    <ul>
      {listPokemons}
    </ul>
  );
}

function App() {
  return (
    <div>
      <Teste />
    </div>
  );
}

export default App;
